import React from 'react'

export default function Tweets() {
    return (
        <div className='container'>
            <ul class="collection">
                <li class="collection-item">Alvin</li>
                <li class="collection-item">Alvin</li>
                <li class="collection-item">Alvin</li>
                <li class="collection-item">Alvin</li>
            </ul>
        </div>
    )
}
